```javascript
const { Client, SlashCommandBuilder } = require('discord.js');

// Create a new Discord client
const client = new Client({ intents: [
  // Add the required intents here, e.g. Guilds
] });

// Create the ban command
const banCommand = new SlashCommandBuilder()
 .setName('ban')
 .setDescription('Bans a user from the server.')
 .addUserOption(option =>
    option.setName('target')
   .setDescription('The user to ban')
  )
 .addIntegerOption(option =>
    option.setName('duration')
   .setDescription('Duration of the ban in days')
  )
 .addStringOption(option =>
    option.setName('reason')
   .setDescription('Reason for the ban')
  );

// Register the ban command
client.commands = new Discord.Collection();
client.commands.set(banCommand.data.name, banCommand);

// Handle the ready event
client.once('ready', () => {
  console.log(`Logged in as ${client.user.tag}!`);
});

// Handle the interactionCreate event
client.on('interactionCreate', async interaction => {
  if (!interaction.isCommand()) return;

  const { commandName, options } = interaction;

  if (commandName === 'ban') {
    const target = options.get('target').user;
    const duration = options.getInteger('duration') * 86400;
    const reason = options.getString('reason');

    try {
      if (!interaction.member.permissions.has('BAN_MEMBERS')) {
        return interaction.reply({
          content: 'You do not have the required permissions to ban members.',
          ephemeral: true,
        });
      }

      if (target === interaction.user) {
        return interaction.reply({
          content: 'You cannot ban yourself.',
          ephemeral: true,
        });
      }

      // Ban the user
      await interaction.guild.members.ban(target, {
        days: duration,
        reason: reason,
      });

      interaction.reply({
        content: `Successfully banned <@${target.id}>.`,
        ephemeral: true,
      });
    } catch (error) {
      console.error(error);
      interaction.reply({
        content: 'There was an error while trying to ban the user.',
        ephemeral: true,
      });
    }
  }
});

// Login to Discord
client.login('YOUR_BOT_TOKEN');
```
1. Replace `YOUR_BOT_TOKEN` with your bot's token.
2. Add the required intents for the bot. You can find the list of available intents [here](https://discord.com/developers/docs/interactions/intents).
3. Run the bot:
```bash
node bot.js
```
