```
#include <string>
#include <iostream>
#include <unordered_map>

std::string markdown_to_html(const std::string& markdown_text) {
    std::string html_text;
    std::unordered_map<std::string, std::string> markdown_to_html_map = {
        {"\\*", "**"},
        {"_", "*"},
        {"#", "<h1>"},
        {"##", "<h2>"},
        {"###", "<h3>"},
        {"\\_", "<em>"},
        {"\\*", "<b>"},
        {"{", "<ul><li>"},
        {"\\*", "<li>"},
        {"\\.", "</li></ul>"},
        {"\\*\\*", "**"},
        {"\\*_", "<b>*"},
        {"\\_\\*","*"},
        {"\\*\\_","*"},
    };

    std::string::const_iterator it = markdown_text.begin();
    while (it!= markdown_text.end()) {
        std::string temp = markdown_text.substr(it - markdown_text.begin(), it - markdown_text.begin() + 1);
        if (markdown_to_html_map.count(temp)!= 0) {
            html_text.append(markdown_to_html_map[temp]);
            it++;
        } else {
            html_text.push_back(*it);
        }
        it++;
    }

    return html_text;
}
```
This function uses a map to map the markdown symbols to the corresponding HTML symbols. It iterates through the input string and replaces the markdown symbols with the corresponding HTML symbols. Note that this implementation only handles a limited subset of markdown syntax (headings, bold, italic, bullet lists), you can add more syntax by adding more key-value pairs to the `markdown_to_html_map` map.

It is also important to note that this function uses C++11 features like `unordered_map`, `substr`, and `auto` which may require upgrades for older versions of C++.

